// src/components/sections/Skills.jsx
import React from "react";
import { useTheme } from "../../context/ThemeContext";

const Skills = () => {
  const { darkMode } = useTheme();

  // Définition des icônes inline SVG
  const Braces = () => (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-8 h-8">
      <path d="M7 8H3a2 2 0 0 0-2 2v4a2 2 0 0 0 2 2h4"></path>
      <path d="M17 16h4a2 2 0 0 0 2-2v-4a2 2 0 0 0-2-2h-4"></path>
      <path d="M3 16V8a2 2 0 0 1 2-2h2"></path>
      <path d="M15 4h2a2 2 0 0 1 2 2v8"></path>
    </svg>
  );

  const Server = () => (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-8 h-8">
      <rect x="2" y="2" width="20" height="8" rx="2" ry="2"></rect>
      <rect x="2" y="14" width="20" height="8" rx="2" ry="2"></rect>
      <line x1="6" y1="6" x2="6.01" y2="6"></line>
      <line x1="6" y1="18" x2="6.01" y2="18"></line>
    </svg>
  );

  const Globe = () => (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-8 h-8">
      <circle cx="12" cy="12" r="10"></circle>
      <line x1="2" y1="12" x2="22" y2="12"></line>
      <path d="M12 2a15.3 15.3 0 0 1 4 10 15.3 15.3 0 0 1-4 10 15.3 15.3 0 0 1-4-10 15.3 15.3 0 0 1 4-10z"></path>
    </svg>
  );

  const Palette = () => (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-6 h-6">
      <circle cx="13.5" cy="6.5" r=".5"></circle>
      <circle cx="17.5" cy="10.5" r=".5"></circle>
      <circle cx="8.5" cy="7.5" r=".5"></circle>
      <circle cx="6.5" cy="12.5" r=".5"></circle>
      <path d="M12 2C6.5 2 2 6.5 2 12s4.5 10 10 10c.926 0 1.648-.746 1.648-1.688 0-.437-.18-.835-.437-1.125-.29-.289-.438-.652-.438-1.125a1.64 1.64 0 0 1 1.668-1.668h1.996c3.051 0 5.555-2.503 5.555-5.554C21.965 6.012 17.461 2 12 2z"></path>
    </svg>
  );

  const Code2 = () => (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-6 h-6">
      <path d="m18 16 4-4-4-4"></path>
      <path d="m6 8-4 4 4 4"></path>
      <path d="m14.5 4-5 16"></path>
    </svg>
  );

  // Définition des catégories de compétences
  const skillCategories = [
    {
      title: "Frontend",
      icon: <Braces />,
      color: "text-blue-500",
      skills: [
        {
          name: "React & Next.js",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/react/react-original.svg",
          isImage: true,
        },
        {
          name: "Vue.js & Nuxt",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/vuejs/vuejs-original.svg",
          isImage: true,
        },
        {
          name: "TypeScript",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/typescript/typescript-original.svg",
          isImage: true,
        },
        {
          name: "Tailwind CSS",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/tailwindcss/tailwindcss-plain.svg",
          isImage: true,
        },
      ],
    },
    {
      title: "Backend",
      icon: <Server />,
      color: "text-green-500",
      skills: [
        {
          name: "Node.js",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/nodejs/nodejs-original.svg",
          isImage: true,
        },
        {
          name: "Python",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg",
          isImage: true,
        },
        {
          name: "PostgreSQL",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/postgresql/postgresql-original.svg",
          isImage: true,
        },
        {
          name: "MongoDB",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mongodb/mongodb-original.svg",
          isImage: true,
        },
      ],
    },
    {
      title: "Design",
      icon: <Globe />,
      color: "text-purple-500",
      skills: [
        {
          name: "Figma",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/figma/figma-original.svg",
          isImage: true,
        },
        {
          name: "Adobe XD",
          icon: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/xd/xd-plain.svg",
          isImage: true,
        },
        { name: "UI/UX Design", icon: <Palette /> },
        { name: "Design System", icon: <Code2 /> },
      ],
    },
  ];

  return (
    <section
      id="skills"
      className="min-h-screen flex items-center justify-center p-8 pt-32 pb-32"
    >
      <div className="max-w-7xl mx-auto px-6">
        <div className="text-center mb-20">
          <h2 className={`text-4xl font-bold mb-4 ${darkMode ? "text-white" : "text-gray-800"}`}>Expertise</h2>
          <p
            className={`max-w-2xl mx-auto ${
              darkMode ? "text-gray-400" : "text-gray-600"
            }`}
          >
            Fort d'une expertise technique approfondie et d'un sens aigu du
            design, je développe des applications web modernes et
            performantes.
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-10">
          {skillCategories.map((category, index) => (
            <div
              key={index}
              className={`group relative overflow-hidden p-8 rounded-3xl transition-all duration-500 ${
                darkMode
                  ? "bg-gradient-to-br from-white/5 to-white/10 hover:from-white/10 hover:to-white/15"
                  : "bg-gradient-to-br from-gray-50 to-gray-100 hover:from-gray-100 hover:to-gray-200"
              } shadow-lg border ${
                darkMode ? "border-white/10" : "border-gray-200"
              }`}
            >
              {/* Cercle décoratif */}
              <div
                className={`absolute -top-20 -right-20 w-40 h-40 rounded-full opacity-20 transition-all duration-500 group-hover:scale-150 ${
                  index === 0
                    ? "bg-blue-500"
                    : index === 1
                    ? "bg-green-500"
                    : "bg-purple-500"
                }`}
              ></div>

              <div
                className={`relative z-10 w-16 h-16 mb-6 flex items-center justify-center rounded-2xl ${
                  darkMode
                    ? `bg-gradient-to-br ${
                        index === 0
                          ? "from-blue-900/30 to-blue-700/30"
                          : index === 1
                          ? "from-green-900/30 to-green-700/30"
                          : "from-purple-900/30 to-purple-700/30"
                      }`
                    : `bg-gradient-to-br ${
                        index === 0
                          ? "from-blue-50 to-blue-100"
                          : index === 1
                          ? "from-green-50 to-green-100"
                          : "from-purple-50 to-purple-100"
                      }`
                }`}
              >
                <div className={category.color}>{category.icon}</div>
              </div>

              <h3 className={`text-2xl font-semibold mb-4 relative z-10 ${darkMode ? "text-white" : "text-gray-800"}`}>
                {category.title}
              </h3>

              <div className="space-y-5 relative z-10">
                {category.skills.map((skill, skillIndex) => (
                  <div
                    key={skillIndex}
                    className={`flex items-center gap-3 py-4 px-5 rounded-xl ${
                      darkMode
                        ? "bg-white/5 hover:bg-white/10"
                        : "bg-white hover:bg-gray-50"
                    } transition-colors duration-300`}
                  >
                    <div
                      className={`flex items-center justify-center w-8 h-8 rounded-lg ${
                        darkMode ? "bg-white/10" : "bg-gray-100"
                      }`}
                    >
                      {skill.isImage ? (
                        <img
                          src={skill.icon}
                          className="w-5 h-5"
                          alt={skill.name}
                        />
                      ) : (
                        <div className="w-5 h-5 flex items-center justify-center">
                          {skill.icon}
                        </div>
                      )}
                    </div>
                    <span className={darkMode ? "text-gray-300" : "text-gray-700"}>
                      {skill.name}
                    </span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
